import axios from "axios";

const url = "https://api.github.com/users/example";

const Fetch = async () => {
  try {
    const {
      data: { html_url },
    } = await axios.get(url);
    return { html_url };
  } catch (error) {
    console.log(error);
  }
};

export default Fetch;
